GtkWidget*
create_dialogSuppServ (void)
{
  GtkWidget *dialogSuppServ;
  GtkWidget *dialog_vbox1;
  GtkWidget *fixed112;
  GtkWidget *label1052;
  GtkWidget *dialog_action_area1;
  GtkWidget *cancelbutton1;
  GtkWidget *okbutton1;

  dialogSuppServ = gtk_dialog_new ();
  gtk_window_set_type_hint (GTK_WINDOW (dialogSuppServ), GDK_WINDOW_TYPE_HINT_DIALOG);
  gtk_dialog_set_has_separator (GTK_DIALOG (dialogSuppServ), FALSE);

  dialog_vbox1 = GTK_DIALOG (dialogSuppServ)->vbox;
  gtk_widget_show (dialog_vbox1);

  fixed112 = gtk_fixed_new ();
  gtk_widget_show (fixed112);
  gtk_box_pack_start (GTK_BOX (dialog_vbox1), fixed112, TRUE, TRUE, 0);

  label1052 = gtk_label_new (_("Voulez vous vraiment supprimez ce service?"));
  gtk_widget_show (label1052);
  gtk_fixed_put (GTK_FIXED (fixed112), label1052, 552, 360);
  gtk_widget_set_size_request (label1052, 728, 136);

  dialog_action_area1 = GTK_DIALOG (dialogSuppServ)->action_area;
  gtk_widget_show (dialog_action_area1);
  gtk_button_box_set_layout (GTK_BUTTON_BOX (dialog_action_area1), GTK_BUTTONBOX_END);

  cancelbutton1 = gtk_button_new_from_stock ("gtk-cancel");
  gtk_widget_show (cancelbutton1);
  gtk_dialog_add_action_widget (GTK_DIALOG (dialogSuppServ), cancelbutton1, GTK_RESPONSE_CANCEL);
  GTK_WIDGET_SET_FLAGS (cancelbutton1, GTK_CAN_DEFAULT);

  okbutton1 = gtk_button_new_from_stock ("gtk-ok");
  gtk_widget_show (okbutton1);
  gtk_dialog_add_action_widget (GTK_DIALOG (dialogSuppServ), okbutton1, GTK_RESPONSE_OK);
  GTK_WIDGET_SET_FLAGS (okbutton1, GTK_CAN_DEFAULT);

  /* Store pointers to all widgets, for use by lookup_widget(). */
  GLADE_HOOKUP_OBJECT_NO_REF (dialogSuppServ, dialogSuppServ, "dialogSuppServ");
  GLADE_HOOKUP_OBJECT_NO_REF (dialogSuppServ, dialog_vbox1, "dialog_vbox1");
  GLADE_HOOKUP_OBJECT (dialogSuppServ, fixed112, "fixed112");
  GLADE_HOOKUP_OBJECT (dialogSuppServ, label1052, "label1052");
  GLADE_HOOKUP_OBJECT_NO_REF (dialogSuppServ, dialog_action_area1, "dialog_action_area1");
  GLADE_HOOKUP_OBJECT (dialogSuppServ, cancelbutton1, "cancelbutton1");
  GLADE_HOOKUP_OBJECT (dialogSuppServ, okbutton1, "okbutton1");

  return dialogSuppServ;
}

